Give And Take

Nature Documentary hosted by Simon Shrimpton-Smith, published by Nature Conservation Films in 2001 - English narration


Information
------------------------------

A documentary about the north European wetlands
The Wadden Sea is a dynamic environment with huge changing tides that create a tidal flat of 8.000 square kilometres - the largest coastal wetland in Europe. The animals and plants that live here - in the water, on the seabed or on land - have adapted remarkable strategies to survive in such a variable environment. The natural world of which they are a part has evolved a finely-tuned balancing act. However, the encroachment of man is putting new pressures on it. This 52 minute special explores the many colourful creatures and plants that eke out an existence on this vast tidal flat, the effects of pollution and development, and the efforts of conservationists to preserve the wetland's delicate balance.

